import React from 'react';
import Profile from './profile';

class Body extends React.Component{

    render(){
        let id = parseInt(this.props.activeId);
        let content;
        switch (id){
            case 1:
                content = <Profile />
                break
            default:
                content = <Profile />
        }

        return <div className="BodyPart"></div>
    }

}

export default Body;
